import React from 'react';

interface ContentProps {
  selectedProductId: number | null; // Add this interface to define the prop type
}

const Content: React.FC<ContentProps> = ({ selectedProductId }) => {
  return (
    <div>
      {selectedProductId ? (
        <p>Selected Product ID: {selectedProductId}</p>
      ) : (
        <p>No product selected yet.</p>
      )}
    </div>
  );
};

export default Content;
